import React from 'react';
import {Container, Typography} from "@material-ui/core";
import styles from "./styles";

const Title = () =>{
    return(
        <Container>
            <Typography variant={'h6'}>Конференции</Typography>
            <hr style={styles.line}/>
        </Container>
    )
};

export default Title;
